import React from 'react'
import {ExpenseItem} from './ExpenseItem';

const Expenses = (props) => {
    return (
        <div>
            <ExpenseItem title = {props.items.title[0]} amount={props.items.amount[0]} date = {props.items.date[0]}></ ExpenseItem >
            <ExpenseItem title = {props.items.title[1]} amount={props.items.amount[1]} date = {props.items.date[1]}></ ExpenseItem >
            <ExpenseItem title = {props.items.title[2]} amount={props.items.amount[2]} date = {props.items.date[2]}></ ExpenseItem >
            <ExpenseItem title = {props.items.title[3]} amount={props.items.amount[3]} date = {props.items.date[3]}></ ExpenseItem >
        </div>
    )
}

export default Expenses;
